#include <iostream>
#include <vector>
#include <unordered_map>
#include <algorithm>
#include <set>
#include <unordered_set>

using namespace std;

class Solution {
    public:
        int subarraySum(vector<int>& nums, int k) {
            int count = 0;
            vector<int> result = nums;
            for (int i = 0; i < nums.size(); i++) {
                int pos = i+1;
                
                while (pos <= nums.size()) {
                    if(result[i] == k) {
                        count++;
                    }
                    if (pos < nums.size()) {
                        result[i] += nums[pos];
                    }
                    pos++;
                }
            }
            return count;
        }
        int subarraySumPre(vector<int>& nums, int k) {
            unordered_map<int, int> mp;
            mp[0] = 1;
            int count = 0, pre = 0;
            for (auto& x:nums) {
                pre += x;
                if (mp.find(pre - k) != mp.end()) {
                    count += mp[pre - k];
                }
                mp[pre]++;
            }
            return count;
        }
    };

